import React, { Component } from 'react'
import {Card,Button} from 'antd'

export default class Category extends Component {
    render() {
        const title =(
            <span>
                一级分类列表
                <Button type="primary">添加</Button>
            </span>
        )
        return (
            <Card title={title} style={{width: '100%',height: '100%'}}>
                
            </Card>
        )
    }
}
